// src/components/Navbar.js
import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
  return (
    <nav>
      <ul>
        <li>
         
        </li>
        <li>
          <Link to="/login"></Link>
        </li>
        <li>
          <Link to="/dashboard"></Link>
        </li>
      </ul>
    </nav>
  );
};

export default Navbar;
